import React, {useState} from 'react';
import './App.css';

import ProductInput from './components/ProductInput';
import ProductTypeSelect from './components/ProductTypeSelect';

interface IState {
  product: {
    name: string
    amount: number
    type: string
  }[]
}

function App() {
  const [products, setProducts] = useState<IState["product"]>([]);

  return (
    <div className="App">
      <h1>רשימת קניות</h1>
      <ProductInput/>
      <ProductTypeSelect />
    </div>
  );
}

export default App;
